INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, 0, 2, 1001, "お！\nあそこに困ってそうな人発見！", "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 0, 1, 0, 0, "春咲 ひより", 1.4, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, 0, 2, 1002, "大切な人を\n守れるようになりたい…って", "みんなみたいに\nわたしも強くならなきゃ", "わ、わたし、\nなに言ってるんだろ\nあはは…", 0, 1, 0, 0, "草野 優衣", 1.4, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, 0, 2, 1003, "キミに必要な集中力と感性が", "フェンシングを始めてみては？", "少しは磨かれると思いますよ。", 0, 1, 0, 0, "士条 怜", 1.4, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, 0, 2, 1004, "今日はなにして遊ぶ？", "ねぇ、にいちゃん！", "みそぎはねぇ、\nかくれんぼやりたい！", 0, 1, 0, 0, "穂高 みそぎ", 1.5, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, 0, 2, 1006, "ねぇ…", "風宮あかりです", "私といっしょに…\nいかない？", 0, 1, 0, 0, "風宮 あかり", 1.4, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, 0, 2, 1007, "プリンたべたいのー", "出雲宮子なのー", "食べ物の恨みは怖いのー", 0, 1, 0, 0, "出雲 宮子", 1.5, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, 0, 2, 1008, "キミもボクの美貌に\n吸い寄せられたんだね。", "ボクは虹村雪。", "いいよ。\n見られることは運命さ…", 0, 1, 0, 0, "虹村 雪", 1.4, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, 0, 2, 1009, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", "フッ…聞いて後悔するがいい！", "人呼んで「疾風の冥姫」!!", 0, 1, 0, 0, "柊杏奈", 1.4, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, 0, 2, 1010, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", "マホマホ王国のプリンセス、\nまほ姫どす", "ほんまおおきにやわ～♪", 0, 1, 0, 0, "姫宮 真歩", 1.5, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, 0, 2, 1011, "生き別れたお兄ちゃんを探して\n三千世界！", "衣之咲璃乃です！", "ここで会ったが\n100年目～！", 0, 1, 0, 0, "衣之咲 璃乃", 1.4, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, 0, 2, 1012, "ち、超能力って…\n何のことかな～？", "私はハツネ、\n結構強いんだよ。\nきらーん☆", "…って、お願い！\n誰にも言わないでおいて～！", 0, 1, 0, 0, "柏崎 初音", 1.4, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, 0, 2, 1016, "一応カリスマ読モJKやってまっす！", "ちょす！\n美波鈴奈だよ～♪", "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 0, 1, 0, 0, "美波 鈴奈", 1.4, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, 0, 2, 1017, "東京は遊園地みたいなところさー", "はいたーい。\n喜屋武香織さー。", "でも、沖縄もとってもいいとこさー", 0, 1, 0, 0, "喜屋武 香織", 1.4, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, 0, 2, 1018, "先生って呼ばれるのは\nくすぐったいから", "支倉伊緒です。", "イオちゃんって呼んでね。", 0, 1, 0, 0, "支倉 伊緒", 1.4, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, 0, 2, 1020, "あ！/\お兄ちゃ～ん\nまってよ～", "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", "ミミをおいてかないでぇ～", 0, 1, 0, 0, "茜 ミミ", 1.5, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, 0, 2, 1021, "あの……\nふぇ……", "あ…あの…えっと…\n栗…林…くるみ…です……", "ふぇぇぇぇぇん……", 0, 1, 0, 0, "栗林 くるみ", 1.5, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, 0, 2, 1022, "こんな私に貴重な時間を\n割いていただき、", "風宮よりです。\nあああああ！", "なんてありがとうございます！", 0, 1, 0, 0, "風宮 より", 1.4, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, 0, 2, 1023, "おにいちゃんどこいくの？\nえ？", "私、アヤネ！\nぷうきちと一緒についてってあげるね！", "私こっち行きたいー\nね、早く早くー", 0, 1, 0, 0, "北条 綾音", 1.5, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, 0, 2, 1025, "ふ、不束者ですが\nどうぞ末永く…って、", "わっ…わっ…私、\n天野すずめといいます！", "これて何か違う…\nあああすみません！", 0, 1, 0, 0, "天野 すずめ", 1.4, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, 0, 2, 1027, "あなたは…運命の……\n伴侶……", "……クスクス…私は\n…倉石恵理子……", "離しませんわ………\n絶対に…!!", 0, 1, 0, 0, "倉石 恵理子", 1.4, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, 0, 2, 1028, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", "…そうでしょ？？", 0, 1, 0, 0, "佐々木 咲恋", 1.4, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, 0, 2, 1029, "ぇっと…\nキミ、私のこと知らないの?!", "桜井望だよ！\nよろしくねっ", "あはは、\n私もまだまだだなぁ～", 0, 1, 0, 0, "桜井 望", 1.4, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, 0, 2, 1030, "初めまして、\n私はニノン・ジュベール申すデス！", "デケデケデンっ！", "ショーグン、\nワタシと一緒に天下統一デース！", 0, 1, 0, 0, "ニノン・ジュベール", 1.4, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, 0, 2, 1031, "でもって私の隣にいるのが……\nえ、見えない？", "上喜しのぶです。\n手元のドクロが父です。", "おかしいですね……", 0, 1, 0, 0, "上喜 しのぶ", 1.4, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, 0, 2, 1033, "けんども\nそれには足りないモンが…", "目指すはビッグな\nお笑い芸人だっぺ！", "そう、\nオラのボケに突っ込める相方が…！", 0, 1, 0, 0, "野戸まひる", 1.5, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, 0, 2, 1034, "ちょっと緊張しちゃって…", "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", "ちょ\nちょっと一杯飲んできます…！", 0, 1, 0, 0, "綾瀬 ゆかり", 1.4, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, 0, 2, 1036, "知らない人とは話しちゃいけないので", "氷川鏡華…です", "これ以上お話しすることは…\nないです！", 0, 1, 0, 0, "氷川 鏡華", 1.5, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, 0, 2, 1038, "……あ、アラーム。", "柏崎…栞です。", "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 0, 1, 0, 0, "柏崎 栞", 1.4, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, 0, 2, 1040, "私、一人も友達がいなくて……", "ふ、双葉碧です。", "野に咲く花が、\n唯一の話相手です。", 0, 1, 0, 0, "双葉 碧", 1.4, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, 0, 2, 1042, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", "三角千歌です。", "そう思っています。", 0, 1, 0, 0, "三角 千歌", 1.4, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, 0, 2, 1043, "あぁ？\nお前のそいつの仲間か？", "安芸真琴だ。", "う、疑ってすまなかったな…", 0, 1, 0, 0, "安芸 真琴", 1.4, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, 0, 2, 1044, "生けとし生ける全ての者よ！", "わらわこそは夜を総べる者！", "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 0, 1, 0, 0, "イリヤ・オーンスタイン", 1.4, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, 0, 2, 1045, "ぐふふふふ……はっ！", "そこで騎士は妖精を乱暴に……", "ｌク、クウカに何かご用ですか!?", 0, 1, 0, 0, "遠見 空花", 1.4, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, 0, 2, 1046, "自由気ままで♪\n寝て遊んで、食べてケンカして…", "宮坂たまきにゃ♪\n猫はいいにゃよ？", "う～ん…\n猫ってホントに最高にゃ～♪", 0, 1, 0, 0, "宮坂たまき", 1.4, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, 0, 2, 1048, "それでは早速クエストに…", "大神美冬よ！", "…と思ったら\nバイトの時間だ！\nまたあとでね！", 0, 1, 0, 0, "大神 美冬", 1.4, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, 0, 2, 1049, "クエストもバトルも\n掃除も洗濯も", "星野静流だよ！", "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 0, 1, 0, 0, "星野静流", 1.4, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, 0, 2, 1050, "見ての通りの\nセクシー美少女で", "アタシは玉泉美咲。", "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 0, 1, 0, 0, "玉泉美咲", 1.5, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, 0, 2, 1052, "？？？？", "？？？", "？？？？", 0, 1, 0, 0, "リマ", 1.4, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, 0, 2, 1053, "菓子でつろうなどと\n稚拙な策を……", "モニカ・ヴァイスヴィントだ。", "そ、そこまでいうなら\nもらってやる", 0, 1, 0, 0, "モニカ・ヴァイスヴィント", 1.5, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, 0, 2, 1058, "菓子でつろうなどと\n稚拙な策を……", "モニカ・ヴァイスヴィントだ。", "そ、そこまでいうなら\nもらってやる", 0, 1, 0, 0, "ペコリーヌ", 1.5, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, 0, 2, 1059, "菓子でつろうなどと\n稚拙な策を……", "モニカ・ヴァイスヴィントだ。", "そ、そこまでいうなら\nもらってやる", 0, 1, 0, 0, "コッコロ", 1.5, 1);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, 0, 0, 2, 1060, "菓子でつろうなどと\n稚拙な策を……", "モニカ・ヴァイスヴィントだ。", "そ、そこまでいうなら\nもらってやる", 0, 1, 0, 0, "キャル", 1.5, 1);
